import React from "react";

export const ResultStatistics = ({ gameStats }) => {
  return (
    <div className=" absolute grid grid-cols-2 gap-4">
      <div className="card bg-dark text-white">
        <div className="card-body">
          <h5 className="card-title">Correct</h5>
          <p className="card-text">{gameStats.guessResult}</p>
        </div>
      </div>
      <div className="card bg-dark text-white">
        <div className="card-body">
          <h5 className="card-title">Incorrect</h5>
          <p className="card-text">{gameStats.guessResult}</p>
        </div>
      </div>
    </div>
  );
};
export default ResultStatistics;
